INSERT INTO `articulos` (`id_articulos`, `nombre_articulo`, `contenido_articulo`, `url_articulo`, `fecha_articulo`, `categoria_id_categoria`) VALUES
(1, 'Becas Periodo 2015', 'Las becas del segundo semestre del año 2015. ya no pueden ser cobradas.\r\n\r\n', 'becas-periodo-2015', '2016-03-01', 1),
(2, 'Becas Facultad de Ciencias Sociales', 'Las becas de los departamentos de Periodismo, Psicología, Trabajo Social, Sociología y Antropología Aùn no has sido cargadas al sistema', 'becas-facultad-de-ciencias-sociales', '2016-03-23', 1),
(3, 'Hoy se cargaron las becas de Sociología', 'Desde hoy lunes 18 de Abril, los alumnos de la carrera de Sociología podrán cobrar sus becas de Fotocopia e Impresión, en el centro de Fotocopiado San Sebastián Ubicado en el primer piso de la facultad de Ciencias Sociales.\nLos alumnos en esta oportunidad cuentas con un total de 204 becas de impresión y 330 becas de fotocopia, beneficiando a 160 alumnos de la carrera.  ', 'hoy-se-cargaron-las-becas-de-Sociología', '2016-04-18', 1),
(6, 'Las becas de Trabajo Social ya están disponibles', 'Desde hoy lunes 19 de Abril, los alumnos de la carrera de Trabajo Social podrán cobrar sus becas de Fotocopia e Impresión, en el centro de Fotocopiado San Sebastián Ubicado en el primer piso de la facultad de Ciencias Sociales.\nLas becas están divididas en dos grupos el primer grupo tiene 100 becas de fotocopia y 200 becas de impresión y el segundo grupo tiene  50 becas de fotocopias y 100 becas de impresión  ', 'las-becas-de-trabajo-social-ya-estan-disponibles', '2016-04-19', 1),
(4, 'Conoce el estado de tus becas', 'Para saber si tienes becas y cual es el estado actual de estas, debes ir al menu \"Consulta tus Becas\", ingresa tu numero de matricula y podras conocer el estado actual de tus becas.', 'conoce-el-estado-de-tus-becas', '2016-04-19', 1),
(7, 'Lista de Becados de Psicología', 'Desde hoy lunes 25 de Abril, los alumnos de la carrera de Psicología podrán cobrar sus becas de Fotocopia e Impresión, en el centro de Fotocopiado San Sebastián. Ubicado en el primer piso de la facultad de Ciencias Sociales.\r\n', 'lista-de-Becados-de-Psicología', '2016-04-25', 1),
(8, 'Hoy se cargaron las becas de Periodismo', 'Desde hoy lunes 02 de Mayo, los alumnos de la carrera de Periodismo podrán cobrar sus becas de Fotocopia e Impresión, en el centro de Fotocopiado San Sebastián Ubicado en el primer piso de la facultad de Ciencias Sociales.\r\nLos alumnos en esta oportunidad cuentas con un total de 300 becas de impresión y 200 becas de fotocopia, beneficiando a 92 alumnos de la carrera. ', 'hoy-se-cargaron-las-becas-de-periodismo', '2016-05-02', 1),
(9, 'Las Becas de Antropología ya se Encuentran Disponibles', 'A partir de el lunes 16 de Mayo las becas de la carrera de Antropología podrán ser cobradas en la fotocopiadora que se encuentra ubicada en el hall del primer piso de la facultad.\r\nEn esta oportunidad los becados cuentan con 200 becas de fotocopias y 174 becas de impresión, beneficiando a 132 alumnos.', 'las-becas-de-antropologia-ya-se-encuentran-disponibles', '2016-05-16', 1),
(10, 'Becas Segundo Semestre Trabajo Social', 'Las becas de trabajo social estarán disponibles a contar del día jueves 03 de Noviembre. Las cuales pueden ser cobradas en la fotocopiadora que está ubicada en el primer piso de la Facultad de Ciencias Sociales de la Universidad de Concepción.', 'becas-trabajo-social-segundo-semestre', '2016-10-03', 1),
(11, 'Becas de Fotocopia e Impresión Carrera de Antropología', 'Las becas de Antropología estarán disponibles a contar del día Viernes 21 de Abril. Las cuales pueden ser cobradas en la fotocopiadora que está ubicada en el primer piso de la Facultad de Ciencias Sociales de la Universidad de Concepción.', 'becas-antropologia-primer-semestre-2017', '2017-04-20', 1),
(12, 'Becas Fotocopias e impresión Segundo Semestre 2017', 'Hoy 24 de Agosto, las becas de Psicología, Sociología y Periodismo estarán disponibles para los alumnos beneficiados. Las cuales pueden ser cobradas en la fotocopiadora que está ubicada en el primer piso de la Facultad de Ciencias Sociales de la Universidad de Concepción.\r\nPara saber el monto de tu beca ve a la sección \"CONSULTA TUS BECAS\"', 'becas-fotocopias-e-impresion-segundo-semestre-2017', '2017-08-24', 1);
